=head1 DESCRIPTION

Specifies the C<Customer>'s account details associated with the
C<Opportunity>.

=head1 ATTRIBUTES


=head2 Address => L<Paws::PartnerCentralSelling::Address>

Specifies the end C<Customer>'s address details associated with the
C<Opportunity>.


=head2 AwsAccountId => Str

Specifies the C<Customer> Amazon Web Services account ID associated
with the C<Opportunity>.


=head2 B<REQUIRED> CompanyName => Str

Specifies the end C<Customer>'s company name associated with the
C<Opportunity>.


=head2 Duns => Str

Indicates the C<Customer> DUNS number, if available.


=head2 Industry => Str

Specifies the industry the end C<Customer> belongs to that's associated
with the C<Opportunity>. It refers to the category or sector where the
customer's business operates. This is a required field.


=head2 OtherIndustry => Str

Specifies the end C<Customer>'s industry associated with the
C<Opportunity>, when the selected value in the C<Industry> field is
C<Other>.


=head2 WebsiteUrl => Str

Specifies the end customer's company website URL associated with the
C<Opportunity>. This value is crucial to map the customer within the
Amazon Web Services CRM system. This field is required in all cases
except when the opportunity is related to national security.



